import React from 'react';
import "../styling/style.css";
const Navbar = () => {
    return (
        <nav className={"nav"}>
            <a href="/" className={"site-title"}>Unlimited marketplace</a>
            <ul>
                <li>
                    <a href="/login"></a>
                </li>
                <li>
                    <a href="/logout"></a>
                </li>
                <li>
                    <a href="/account"></a>
                </li>
                <li>
                    <a href="/buysell"></a>
                </li>
                <li>
                    <a href="/home"></a>
                </li>
            </ul>
        </nav>
    );
};

export default Navbar;
